import React from 'react'
import { Instagram, Twitter, Youtube, Calendar, Mail } from 'lucide-react'
import './HomePage.css'
import poster from '../assets/poster.png'

const HomePage = () => {
    const socialLinks = [
        { icon: <Instagram size={18} />, href: 'https://instagram.com/onkaryadav', color: '#E4405F' },
        { icon: <Youtube size={18} />, href: 'https://www.youtube.com/@boi_onkar', color: '#FF0000' },
        { icon: <Twitter size={18} />, href: 'https://twitter.com/onkaryadav', color: '#1DA1F2' },
    ]

    const contactLinks = [
        { title: 'Book a show', subtitle: 'Corporate • College • Private', icon: <Calendar size={22} />, href: 'mailto:bookings@onkaryadav.com', color: '#16a34a' },
        { title: 'Email', subtitle: 'Collabs • Press • Queries', icon: <Mail size={22} />, href: 'mailto:info@onkaryadav.com', color: '#6366f1' }
    ]

    return (
        <div className="homepage" style={{ backgroundImage: `url(${poster})` }}>
            <div className="overlay"></div>
            <div className="container">
                <div className="profile-section">
                    <div className="profile-image">
                        <img
                            src="https://pbs.twimg.com/profile_images/1785653726509312000/6avxY29l_400x400.jpg"
                            alt="Onkar Yadav"
                            onError={(e) => {
                                e.currentTarget.src = 'https://via.placeholder.com/200x200/333/fff?text=OY'
                            }}
                        />
                    </div>
                </div>

                <div className="links-section">
                    {contactLinks.map(link => (
                        <a
                            key={link.title}
                            href={link.href}
                            className="link-card"
                            target="_blank"
                            rel="noopener noreferrer"
                            style={{ ['--accent']: link.color }}
                        >
                            <div className="link-icon" style={{ color: link.color }}>
                                {link.icon}
                            </div>
                            <div className="link-content">
                                <h3>{link.title}</h3>
                                <p>{link.subtitle}</p>
                            </div>
                        </a>
                    ))}
                </div>

                {/* Fixed Social Links Bar */}
                <div className="social-bar">
                    {socialLinks.map((link, i) => (
                        <a
                            key={i}
                            href={link.href}
                            target="_blank"
                            rel="noopener noreferrer"
                            className="social-btn"
                            style={{ backgroundColor: link.color }}
                        >
                            {link.icon}
                        </a>
                    ))}
                </div>

                <div className="footer">
                    <p>© {new Date().getFullYear()} Onkar Yadav</p>
                </div>
            </div>
        </div>
    )
}

export default HomePage
